AbstractImplicitGeometry = pyxb.binding.basis.element(pyxb.namespace.ExpandedName(_Namespace_gml, u'AbstractImplicitGeometry'), AbstractGeometryType, abstract=pyxb.binding.datatypes.boolean(1))
